import React from 'react';
import API from "../../utils/API"




function SubmitButton(props){

    eturn (
        <span className="btn btn-warning submit-btn" {...props} role="button" tabIndex="0" onClick={() => saveData(props.bookid)}>
          Submit Button
        </span>
      );

}

export default SubmitButton;
